import '../App.css'

class Home extends Component {
    render() {
        return (
            <div className="container">
                <div style={{display: flex, flexDirection: column, alignItems: center, justifyContent: center, fontSize: calc("10px" + "2vmin")}}>
                    <p>tugas big data analytics</p>
                </div>
                <div style={{borderWidth: 2, borderColor: 'red', backgroundColor: "#282c34"}}> 

                </div>
            </div>
        );
    }
}

export default Home
